                // res += c_154*(f_8(x) - f_8(g^16372 * z)) / (x - g^16372 * z).
                res := addmod(
                    res,
                    mulmod(mulmod(/*(x - g^16372 * z)^(-1)*/ mload(add(denominatorsPtr, 0xcc0)),
